export class Pixel {

    private _x: number;
    private _y: number;
    private _h: number;

    constructor(x: number = 0, y: number = 0, h: number = 1) {
        this._x = x;
        this._y = y;
        this._h = h;
    }

    get x(): number {
        return this._x;
    }

    get y(): number {
        return this._y;
    }

    get h(): number {
        return this._h;
    }

    set x(newX: number): void {
        this._x = newX;
    }

    set y(newY: number): void {
        this._y = newY;
    }
}
